import React, { useState } from 'react';
const SupermarketProductListingPage = () => {
  const mockProducts = [
    { id: 1, name: 'ice cream', price:20, description: 'ice cream', image: 'data:image/jpeg;base64,' },
    { id: 2, name: 'cake', price: 300, description: 'cake', image: 'data:image/jpeg;base64,' },
    { id: 3, name: 'soaps', price: 54, description: 'soaps', image: 'data:image/jpeg;base64,' },
    { id: 4, name: 'books', price: 99, description: 'books', image: 'data:image/jpeg;base64,' },
    { id: 5, name: 'chocolates', price: 4.74, description: 'chocolates', image: 'data:image/jpeg;base64,' },
    { id: 6, name: 'fruits', price: 12, description: 'fruits', image: 'data:image/jpeg;base64,' },
    { id: 7, name: 'toys', price: 550, description: 'Seedless grapes', image: 'data:image/jpeg;base64,' },
    { id: 8, name: 'vegetables', price: 75, description: 'Sweet watermelon', image: 'data:image/jpeg;base64,' },
    
  ]
  const [currentPage, setCurrentPage] = useState(1);
  const productsPerPage = 6; 
  const indexOfLastProduct = currentPage * productsPerPage;
  const indexOfFirstProduct = indexOfLastProduct - productsPerPage;
  const currentProducts = mockProducts.slice(indexOfFirstProduct, indexOfLastProduct);
  const paginate = (pageNumber) => setCurrentPage(pageNumber);
  return (
    <div className="supermarket-product-listing">
      <h1>Supermarket Product Listing</h1>
      <div className="products-grid">
        {currentProducts.map((product) => (
          <div key={product.id} className="product-item">
            <img src={product.image} alt={product.name} style={{ width: '100px', height: '100px' }} />
            <h3>{product.name}</h3>
            <p>{product.description}</p>
            <p>${product.price.toFixed(2)}</p>
          </div>
        ))}
      </div>
      <div className="pagination">
        {Array.from({ length: Math.ceil(mockProducts.length / productsPerPage) }, (_, index) => (
          <button key={index + 1} onClick={() => paginate(index + 1)}>
            {index + 1}
          </button>
        ))}
      </div>
    </div>
  )
}

export default SupermarketProductListingPage;